import { Switch, Route, Link, Redirect } from "react-router-dom";
function App() {
  return (
    <div className="App">
      <h1>hello, peeps!</h1>
      <Switch>
        <Route path="/">
          <Redirect to="/home">

          </Redirect>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
